import React from "react";
import { Container, Row, Col, Button } from "reactstrap";
import { Link, useNavigate } from "react-router-dom";
import '../styles/Thankyou.css';

const Thankyou = () => {
  const navigate = useNavigate();

  const handleCancelBooking = async () => {
    try {
      // Adjust the payload to match your booking data structure
      const response = await fetch('http://localhost:5000/api/bookings', {
        method: 'DELETE',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          userId: '01', // Replace with the appropriate userId
          bookAt: '2024-09-24', // Replace with the correct booking date
        }),
      });

      if (response.ok) {
        alert('Booking cancelled successfully.');
        navigate('/home'); // Redirect to home or any other page
      } else {
        alert('Failed to cancel the booking.');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <section>
      <Container>
        <Row>
          <Col lg='12' className="pt-5 text-center">
            <div className="thank__you">
              <span>
                <i className="ri-checkbox-circle-fill"></i>
              </span>
              <h1 className="mb-3 fw-semibold">Thank You</h1>
              <h3 className="mb-4">Your Tour is booked</h3>
              <Button className="btn primary__btn w-25">
                <Link to='/home'>Back to Home</Link>
              </Button>
              <Button
                className="btn danger__btn w-25 mt-3"
                onClick={handleCancelBooking}
              >
                Cancel Booking
              </Button>
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default Thankyou;
